import {useEffect} from "react";
import axios from "axios";
import { connect } from "react-redux";
import Layout from "../components/Layout";
import { reauthenticate, getCookie, getProfile } from "../redux/authActions";

const Profile = ({ reauthenticate, getCookie, user, getProfile }) => {
    console.log(user);

    return (
        <Layout title="Profile Page">
            {(user && (
                <div>
                    <h2>Who am i</h2>
                    {JSON.stringify(user)}
                </div>
            )) ||
                'Please sign in'}
        </Layout>
    )
}

Profile.getInitialProps = async(ctx) => {
    const {data} = await axios.get("http://localhost:3000/api/auth/profile/5ea42b795e51a2439429da54");

    return {
        user: data.user
    }
}


export default connect(state => state, { reauthenticate, getProfile })(Profile);
